var Pi = 3.1415926;
var d = 30.;

var basex = [-3., -4., -5., -6.,
             -2., -3., -4.,
             -1., -2.,
             0.];
var basey = [3.,  2.,  1.,  0., 	
             2.,  1.,  0.,
             1.,  0.,
             0.];

PM(0., 0., 0, 0);        
for (var i=0; i<6; i++) {
  // rotation matrix
  var R11 = Math.cos(i*Pi/3.);
  var R12 = -Math.sin(i*Pi/3.);
  var R21 = Math.sin(i*Pi/3.);
  var R22 = Math.cos(i*Pi/3.);

  for (var j=0; j<10; j++) { 
    var x = basex[j] - 1.;
    var y = Math.sqrt(3.) * (basey[j] + 1.);

    var xx = R11*x + R12*y;
    var yy = R21*x + R22*y;
    PM(xx*d, yy*d, 0, 0);
  }
}

